import React from 'react'
import logo from './img/paugur.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={logo} className="logo" alt="Paugur" />
      <p>AI Based Comment Analyzation Tool</p>
    </div>
  );
}

export default App;
